import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Routes, Redirect } from 'react-router-dom';
import AppGeneral from '../General/AppGeneral/AppGeneral';
import AppLivestorm from '../Livestorm/AppLivestorm/AppLivestorm';
import AppLivestormTestHome from '../LivestormTest/LivestormTestHome'

class App extends Component {
  render() {
    return (


          <Routes>
          <Route path="/:url*" exact strict render={props => <Redirect to={`${props.location.pathname}/`}/>}/>

              <Route  path='/' element={<AppGeneral />} />
              <Route path='/livestorm' element={<AppLivestorm />} />
              <Route path='/livestorm-test/*' element={<AppLivestormTestHome />} />

          </Routes>

    );
  }
}

export default App;
